import React from 'react';
import Header from '../../layouts/components/Header';
import Footer from './Footer';
import NavLeft from './NavLeft';

function Home() {
  return (
    <div>
      <Header />
      <div className="content">
        <NavLeft />
        {/* Nội dung chính của trang Home */}
      </div>
      <Footer />
    </div>
  );
}

export default Home;
